import './Options.css';

const Options = () => {
  return (
    <div className="options-wrapper">
      <div className="options">
        <button className="rock">Rock</button>
        <button className="scissors">scissors</button>
        <button className="paper">paper</button>
      </div>
    </div>
  );
};

export default Options;
